  input: '"TEXT","F3XA","C00252940","The original November 20th filing reported $8194.00
    in independent expenditures.  This money represented the cost of email communications
    using express advocacy.  Upon further review, it was determined that these email
    communications were not independent expenditures since the recipients were the
    League of Conservation Voters restricted class, not the general public.  Thus,
    the cost of these communications are being reported as an operating expense on
    line 21.  There are also two itemized contributors on the November 20th report
    that are missing employer and occupations: Joseph K. Davidson and E. H. Kloman.  The
    LCV PAC has been in the process of complying with the FECs best efforts procedures:
    both donors received an original solicitation that had a clear and conspicuous
    request for their contributor information, noting the federal legal requirements
    for the reporting of such information; within 30 days of receiving their contributions,
    both donors were mailed a formal stand-alone request without a solicitation requesting
    the missing information, also stating the federal legal requirements for reporting
    such information.  Also included was a self-addressed stamped envelope and contact
    information in the event the donor needed additional information."'
